// Get instance name (e.g. 4914352-sb1) out of the 'self' link in the REST response
exports.step = function(input) {
	const regex = /^https:\/\/(?<instance>[^.]+)\./;
	const instance = input.self.match(regex).groups.instance;
  return instance;
};

exports.step = function (input) {
  let branch = input.statuses.find(i => i.id === input.newStatusId)?.name;
  const status = branch;
  if (branch === 'Cancelled' || branch === 'Out For Signature') {
    branch = 'Cancelled/Out For Signature';
  }
  return { 
    branch: branch,
    status: status
  };
};

